import React from "react";

const InputForm = (props) => {
  return (
    <form>
      <div>
        <div>
          <label>User Name</label>
          <input type="text"></input>
          <label>Age</label>
          <input type="number" min="0"></input>
        </div>
        <div>
            <Button type="submit">Add User</Button>
        </div>
      </div>
    </form>
  );
};

export default InputForm;
